sys_script_include.script:
var MyDesk_choice_management = Class.create();
MyDesk_choice_management.prototype = {
    initialize: function() {},
    openFloor: function(floorID) {
        var gr = new GlideRecord('sys_choice');
        gr.get(floorID);
        var label = gr.getValue('label');
        gr.setValue('inactive', false);
        gr.update();
    },

    type: 'MyDesk_choice_management'
};
